import React from "react";

const Navbar = Props => {
  return (
    <div className="container-fluid">
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <h2>Navbar</h2>
        <h3 className="text-right">Total offset</h3>
      </nav>
    </div>
  );
};

export default Navbar;
